import { useState, useEffect } from "react"
import { useNavigate } from "react-router-dom"
import { useLocation } from "react-router-dom"
import { DesktopDatePicker } from "@mui/lab"
import { TextField } from "@mui/material"
import Stack from '@mui/material/Stack'
import AdapterDateFns from '@mui/lab/AdapterDateFns'

const SelectDateTimePage = () => {
    const {state} = useLocation()
    const patientId = state.patientId
    const speciality = state.speciality
    const doctorId = state.doctorId
    const navigate = useNavigate()

    const [value, setValue] = useState(new Date('2018-01-01T00:00:00.000Z'))

    const onLogOutSubmit = (e) => {
        e.preventDefault()

        navigate('/', {
        })
    }

    const onBackSubmit = (e) => {
        e.preventDefault()

        navigate('/patient-page/specialities-page/doctor-page', {
            state: {
                patientId : patientId,
                speciality : speciality
            }
        })
    }

    return (
        <div>
            <div className = "row">
                <div style={{color: '#0b4a2b', marginLeft : 50, fontSize : 50}}>DocConnect</div>
                <button className = "btn" style = {{marginLeft : 1000}} type="submit" id='btn-log-out' onClick={(e) => onLogOutSubmit(e)}>
                    Log out
                </button>
            </div>
            <div>
                <div className = "container-2">
                    <LocalizationProvider dateAdapter={AdapterDateFns}>
                        <Stack spacing={3}>
                            <DesktopDatePicker
                                label="For desktop"
                                value={value}
                                minDate={new Date('2017-01-01')}
                                onChange={(newValue) => {
                                    setValue(newValue);
                                }}
                                renderInput={(params) => <TextField {...params} />}
                            />
                        </Stack>
                    </LocalizationProvider>
                    <div className = "row">
                        <button className = "btn" style = {{marginLeft : 120}} type="submit" id='btn-back' onClick={(e) => onBackSubmit(e)}>
                            Back
                        </button>
                    </div>
                </div>
            </div>
        </div>
    )
};

export default SelectDateTimePage;
